import React from "react";
import EnfantSlider from "./EnfantSlider";
import { AiOutlinePlusSquare } from 'react-icons/ai';
import {AiOutlinePlus} from 'react-icons';
import {AiFillPlusCircle} from 'react-icons';


const GstEnfants = () => {
  return (

    <div className="  w-[90%] max-w-[1100px] mt-[5]  mx-auto text-center flex flex-col justify-center text-[#0B0C38] font-inter ">

      <h1 className=" md:text-7xl sm:text-6xl text-4xl font-bold md:py-6 font-concert">
        Espace Parent
      </h1>
      <div className=" grid grid-cols-2  items-center w-full border-b-2 border-red-100 border-t-2 my-3 ">

        

          <h4 className=" md:text-4xl sm:text-3xl pio:text-2xl text-xl font-bold md:py-6 font-concert text-start ml-[5%]  ">
            Mes enfants 
          </h4>
          <button className="bg-[#FB9B90] w-[20%] ml-[75%]  rounded-md font-medium py-1 sm:py-2 md:py-3 text-[#191A43] ring-2 ring-[#ED6361] hover:bg-[#5B112B] hover:text-white hover:scale-105 duration-300">
             
          < AiOutlinePlusSquare size={30} className='  cursor-pointer mx-auto' />
            </button>

          
    

        
      </div>

      <EnfantSlider />



      <p className="md:text-2xl text-xl font-bold text-[#5B112B]">  Ajoutez un enfant en appuyant sur ce button : </p>

      <div className="bg-transparent text-white  flex justify-center items-center my-3 rounded-lg ">

        <button title="Ajouter" className="bg-[#FB9B90]  rounded-md font-bold my-1 px-3 py-3 text-[#191A43] border-5  border-[#ED6361] hover:scale-110 duration-300">
          < AiOutlinePlusSquare size={30} className='  cursor-pointer mx-auto' />
        </button>

      </div>

    </div>

  )
}

export default GstEnfants;
